import { useState } from "react";
import { Card, CardContent } from "@/components/ui/card";
import { Button } from "@/components/ui/button";
import { Input } from "@/components/ui/input";
import { Select, SelectItem } from "@/components/ui/select";
import { LineChart, Line, XAxis, YAxis, Tooltip, ResponsiveContainer } from "recharts";

export default function DividendCalculator() {
    const [formData, setFormData] = useState({
        inflationRate: "",
        dividendGrowthRate: "",
        initialDividendYield: "",
        dividendFrequency: "quarterly",
        taxApplied: "yes",
        reinvestDividends: "yes",
        initialInvestment: "",
        monthlyInvestment: "",
        monthlyIncrease: "",
    });

    const [result, setResult] = useState(null);

    const handleChange = (e) => {
        setFormData({ ...formData, [e.target.name]: e.target.value });
    };

    const handleSubmit = async () => {
        const response = await fetch("http://localhost:8080/api/calculate", {
            method: "POST",
            headers: { "Content-Type": "application/json" },
            body: JSON.stringify(formData),
        });
        const data = await response.json();
        setResult(data);
    };

    return (
        <div className="p-6">
            <Card>
                <CardContent className="grid gap-4 p-4">
                    <h2 className="text-xl font-bold">배당 재투자 계산기</h2>
                    <Input name="inflationRate" placeholder="물가 상승률 (%)" onChange={handleChange} />
                    <Input name="dividendGrowthRate" placeholder="배당 성장률 (%)" onChange={handleChange} />
                    <Input name="initialDividendYield" placeholder="시가 배당률 (%)" onChange={handleChange} />
                    <Select name="dividendFrequency" onChange={handleChange}>
                        <SelectItem value="monthly">월</SelectItem>
                        <SelectItem value="quarterly">분기</SelectItem>
                        <SelectItem value="semi-annual">반기</SelectItem>
                        <SelectItem value="annual">연간</SelectItem>
                    </Select>
                    <Select name="taxApplied" onChange={handleChange}>
                        <SelectItem value="yes">과세 적용</SelectItem>
                        <SelectItem value="no">과세 없음</SelectItem>
                    </Select>
                    <Select name="reinvestDividends" onChange={handleChange}>
                        <SelectItem value="yes">배당 재투자</SelectItem>
                        <SelectItem value="no">배당 인출</SelectItem>
                    </Select>
                    <Input name="initialInvestment" placeholder="초기 투자금 (₩)" onChange={handleChange} />
                    <Input name="monthlyInvestment" placeholder="월 적립식 투자금 (₩)" onChange={handleChange} />
                    <Input name="monthlyIncrease" placeholder="월 적립식 + 증액 (%)" onChange={handleChange} />
                    <Button onClick={handleSubmit}>계산하기</Button>
                </CardContent>
            </Card>

            {result && (
                <Card className="mt-6">
                    <CardContent className="p-4">
                        <h2 className="text-xl font-bold">예상 투자 성장</h2>
                        <ResponsiveContainer width="100%" height={300}>
                            <LineChart data={result.chartData}>
                                <XAxis dataKey="year" />
                                <YAxis />
                                <Tooltip />
                                <Line type="monotone" dataKey="investmentValue" stroke="#8884d8" />
                            </LineChart>
                        </ResponsiveContainer>
                    </CardContent>
                </Card>
            )}
        </div>
    );
}
